import React, { useState } from "react";
import LoginForm from "./LoginForm";

export default function LoginAndSignUp() {
  const [typeOfForm, setTypeOfForm] = useState();

  return (
    <div>
      <div
        onClick={() => {
          setTypeOfForm("login");
        }}
      >
        Log in
      </div>
      <div
        onClick={() => {
          setTypeOfForm("signup");
        }}
      >
        Sign up
      </div>
      <LoginForm typeOfForm={typeOfForm} />
    </div>
  );
}
